'',
'with ',
'account_categories as',
'(',
'select c001 category_id, c002 category_name, c003 category_type, c004 display_order , c005 CATEGORY_BALANCE ',
'  from apex_collections',
'  where collection_name = upper(''account_categories'')',
')',
', account_subcategories as (',
'select c001 SUBCATEGORY_ID, c002 CATEGORY_ID, c003 SUBCATEGORY_NAME, c004 DISPLAY_ORDER, c005 IS_CURRENT  ',
'  from apex_collections',
'  where collection_name = upper(''account_subcategories'')',
')',
', ACCOUNT_CHART as (',
'select c001 ACCOUNT_ID, c002 ACCOUNT_CODE, c003 ACCOUNT_NAME, c004 SUBCATEGORY_ID, c005 IS_ACTIVE ',
'  from apex_collections',
'  where collection_name = upper(''ACCOUNT_CHART'')',
')',
',ACCOUNT_GLEDGER as (    ',
'    select  c001 ENTRY_ID,c002 ACCOUNT_ID, c003 TRANSACTION_DATE, c004 DEBIT_AMOUNT, c005 CREDIT_AMOUNT, c006 DESCRIPTION, c007 POSTING_REFERENCE, c008 FISCAL_YEAR, c009 FISCAL_PERIOD ',
'  from apex_collections',
'  where collection_name = upper(''ACCOUNT_GLEDGER'')',
')',
',aa as (',
'   select a.account_id,',
'          a.account_code,',
'          a.account_name,',
'          a.is_active,',
'          s.subcategory_id,',
'          s.subcategory_name,',
'          s.is_current,',
'          s.display_order subcategory_display_order,',
'          c.category_id,',
'          c.category_name,',
'          c.category_type,',
'          c.category_balance,',
'          c.display_order category_order,',
'          0',
'     from account_chart a',
'     join account_subcategories s',
'   on ( a.subcategory_id = s.subcategory_id )',
'     join account_categories c',
'   on ( s.category_id = c.category_id )',
'),tr as (',
'   select gl.entry_id,',
'          gl.account_id,',
'          gl.transaction_date,',
'          gl.debit_amount,',
'          gl.credit_amount,',
'          gl.description,',
'          gl.posting_reference,',
'          gl.fiscal_year,',
'          gl.fiscal_period',
'     from account_gledger gl',
'),t1 as (',
'   select tr.fiscal_year,',
'  --  tr.FISCAL_PERIOD,',
'          aa.category_id,',
'          aa.category_name,',
'          aa.category_name',
'          ||',
'          case',
'             when is_current = ''Y'' then',
'                   '' - Current''',
'             else',
'                '' - Non Current''',
'          end',
'          as category_display,',
'          aa.category_order,',
'          aa.is_current,',
'          aa.subcategory_name,',
'          sum(aa.category_balance *(tr.credit_amount - tr.debit_amount)) balance',
'     from tr',
'     join aa',
'   on ( tr.account_id = aa.account_id )',
'    where aa.is_active = ''Y''',
'    group by tr.fiscal_year,',
'--    tr.FISCAL_PERIOD,',
'             aa.category_id,',
'             aa.category_name,',
'             aa.category_order,',
'             aa.subcategory_name,',
'             aa.subcategory_display_order,',
'             aa.is_current',
'    order by aa.category_order,',
'             aa.is_current desc,',
'             aa.subcategory_display_order',
')',
', t2 as (select ',
'    fiscal_year,',
'    category_order,',
'    category_name,',
'    category_display,',
'    json_arrayagg(',
'        json_object(',
'               subcategory_name,',
'               balance',
'        )',
'    ) subcategory,',
'    sum(balance) balance',
'  from t1',
'  group by fiscal_year, category_order, category_display , category_name',
'  order by category_order',
')',
'select ',
'    category_order,',
'    category_name,',
'    sum(balance) balance,',
'    json_arrayagg(',
'        json_object(t2.*) ',
'    ) category_current',
'from t2',
'--where :FISCALYEAR is null or fiscal_year = :FISCALYEAR',
'group by category_order,category_name',
'order by category_order',
'',
''))
