 p_id=>wwv_flow_imp.id(43697461104661425137)
,p_process_sequence=>10
,p_process_point=>'AFTER_SUBMIT'
,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'generate-template0'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'/**',
'',
'* Generate template 0 from Query',
'',
'* TODO - (draft) hardcoded only for testing',
'',
'* Version 0.1.1 2025-05-13',
'',
'*/',
'declare',
'',
'    l_req_multipart   apex_web_service.t_multipart_parts;',
'    l_template_blob blob;',
'    l_template_mimetype varchar2(100);',
'    l_fields_data clob;',
'    p_query varchar2(4000) := :P4_QUERY;',
'    l_url VARCHAR2(255) := ''http://sample-nodejs.:4000''; -- put your nodejs server url',
'    p_query0   varchar2(4000) := q''#',
'        SELECT JSON_ARRAYAGG (',
'                    JSON_OBJECT (',
'                        ''deptno'' VALUE d.deptno,',
'                        ''dname'' VALUE d.dname,',
'                        ''emps'' VALUE JSON_ARRAYAGG (',
'                            JSON_OBJECT (',
'                                ''empno'' VALUE e.empno,',
'                                ''ename'' VALUE e.ename,',
'                                ''job'' VALUE e.job,',
'                                ''sal'' value e.sal',
'                            )',
'                        )',
'                    )',
'                ',
'            RETURNING json) AS depts',
'            FROM dept d',
'            LEFT JOIN emp e ON d.deptno = e.deptno',
'            GROUP BY d.deptno, d.dname',
'      #'';',
'    l_data    clob;',
'    ',
'    l_response_clob   CLOB;',
'    l_response_status NUMBER;',
'    l_response_mime   VARCHAR2(250);',
'    l_response_blob   BLOB;',
'',
'begin',
'        <<part_data>>begin ',
'',
'            execute immediate ''SELECT JSON_ARRAYAGG(JSON_OBJECT(*)) AS json_result FROM ( ''',
'                    || p_query || '' )''',
'                -- bulk COLLECT',
'                -- TODO sanitize',
'            into l_data;',
'   ',
'        ',
'      ',
'            with ',
'',
'            a as ( SELECT l_data AS json_clob  FROM dual)',
'            ,b as (select ',
'                    json_dataguide(json_serialize(json_clob)) dg',
'                    from a)',
'            ,c as (',
'                select jt.*',
'                    from b,',
'                        --JSON_DATAGUIDE(p_json) dg,',
'                        json_table ( dg,''$[*]''',
'                            columns (',
'                            path path ''$."o:path"'',',
'                            type varchar2 ( 100 ) path ''$."type"''',
'                            )',
'                        )',
'                    jt',
'                order by jt.path',
'                )',
'            ,d1 as (',
'                select path,',
'                        type,',
'                        substr(',
'                            path,',
'                            3',
'                        ) as p1,',
'                        regexp_count(',
'                            substr(',
'                            path,',
'                            3',
'                            ),',
'                            ''\.''',
'                        ) + 1 as depth,',
'                        max(regexp_count(',
'                            substr(',
'                            path,',
'                            3',
'                            ),',
'                            ''\.''',
'                        ) + 1)',
'                        over() as maxdepth',
'                    from c',
'            ),split_parts as (',
'                select d1.path,',
'                        d1.type,',
'                        d1.depth,',
'                        d1.maxdepth,',
'                        level as part_pos,',
'                        regexp_substr(',
'                            d1.p1,',
'                            ''[^.]+'',',
'                            1,',
'                            level',
'                        ) as part,',
'                        d1.depth as total_parts',
'                    from d1',
'                connect by path = prior path',
'                    and level <= d1.depth',
'                    and prior dbms_random.value is not null',
'            ),processed_parts as (',
'                select path,',
'                        part_pos,',
'                        case',
'                            when part_pos < total_parts then',
'                            part || ''[i]''',
'                            else',
'                            part',
'                        end as processed_part',
'                    from split_parts',
'            ),aggregated_parts as (',
'                select path,',
'                        listagg(processed_part,',
'                                ''.'') within group(',
'                        order by part_pos) as ttag',
'                    from processed_parts',
'                group by path',
'            ),d4 as (',
'                select d1.path,',
'                        d1.type,',
'                        d1.depth,',
'                        d1.maxdepth,',
'                        ''{d[i].''',
'                        || aggregated_parts.ttag',
'                        || ''}'' ttag,',
'                        0 as w',
'                    from d1',
'                    join aggregated_parts',
'                on d1.path = aggregated_parts.path',
'            )',
'            select ',
'                --path, ',
'                --type, ',
'                json_arrayagg(',
'                json_object(',
'                    ''field_tag'' value ttag',
'                )',
'            )',
'                into l_fields_data',
'                from d4',
'                where depth is not null',
'                and type != ''array''',
'                order by path,',
'                        type,',
'                        depth;',
'',
'        end part_data;',
'        <<sending>>',
'        begin',
'        SELECT blob_content, mime_type',
'                INTO l_template_blob ,l_template_mimetype',
'            FROM apex_application_files',
'            WHERE file_type = ''STATIC_FILE''',
'                AND flow_id = v(''APP_ID'')',
'                AND filename = ''template0.docx'';',
'',
'        --l_template_clob64 := apex_web_service.blob2clobbase64(l_template_blob);',
'        apex_web_service.clear_request_headers;',
'        apex_web_service.set_request_headers(',
'            p_name_01  => ''User-Agent'',',
'            p_value_01 => ''PLSQL'', ',
'            p_reset    => TRUE',
'        );',
'        ',
'        apex_web_service.append_to_multipart(p_multipart => l_req_multipart, ',
'            p_name => ''templateEncoding'',  p_body => ''binary'');',
'        ',
'        apex_web_service.append_to_multipart(p_multipart => l_req_multipart, ',
'            p_name => ''templateContent'',   p_body_blob => l_template_blob);            ',
'        ',
'        apex_web_service.append_to_multipart(p_multipart => l_req_multipart,',
'            p_name => ''outputFormat'',p_body      => ''docx'');',
'        ',
'        apex_web_service.append_to_multipart(p_multipart => l_req_multipart,',
'            p_name => ''reportName'',p_body      => ''mytemplate'');',
'        ',
'        apex_web_service.append_to_multipart(p_multipart => l_req_multipart,',
'            p_name => ''jsonData'',p_body      => l_fields_data);',
'',
'',
'        -- Make POST request',
'        l_response_blob := apex_web_service.make_rest_request_b(',
'            p_url         => l_url,',
'            p_http_method => ''POST'',',
'            p_body_blob   => apex_web_service.generate_request_body(l_req_multipart)',
'        );',
'',
'        -- response and status ',
'        l_response_status := apex_web_service.g_status_code;',
'        FOR i in 1.. apex_web_service.g_headers.count LOOP',
'            if ( apex_web_service.g_headers(i).name = ''Content-Type'')  then',
'                l_response_mime := apex_web_service.g_headers(i).value;',
'            end if;',
'        END loop;',
'',
'        IF l_response_status != 200 THEN',
'            -- get error message from response          ',
'            RETURN;',
'        END IF;',
'',
'',
'           apex_http.download(',
'        p_blob         => l_response_blob',
'      , p_content_type => ''application/vnd.openxmlformats-officedocument.wordprocessingml.document''',
'      , p_filename     => ''l_filename''',
'   );',
'   end sending;',
'',
'end;'))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
